import axios from "axios";

export const insertarPrestamo = async (prestamoNuevo) => {
  try {
    const {
      monto,
      plazoMeses,
      fechaInicio,
      numeroPrestamo,
      tasaInteresMoratoria,
      fechaVencimiento,
      diaPago,
      IdClientes,
      clientesPersonaCedula,
      estadoPrestamo,
    } = prestamoNuevo;

    console.log("Datos enviados para insertar préstamo:", {
      monto,
      plazoMeses,
      fechaInicio,
      numeroPrestamo,
      tasaInteresMoratoria,
      fechaVencimiento,
      diaPago,
      IdClientes,
      clientesPersonaCedula,
      estadoPrestamo,
    });

    const response = await axios.post("http://localhost:3333/prestamos/nuevoPrestamo", {
      monto,
      plazoMeses,
      fechaInicio,
      numeroPrestamo,
      tasaInteresMoratoria,
      fechaVencimiento,
      diaPago,
      IdClientes,
      clientesPersonaCedula,
      estadoPrestamo,
    });

    console.log("Respuesta de la API:", response.data);
    return response.data;
  } catch (error) {
    if (error.response) {
      console.error("Error del servidor:", error.response.data);
    } else {
      console.error("Error al insertar el préstamo:", error.message);
    }
    throw error; 
  }
};
